function clean() {
	reg = /(\d{3})\S?\.png$/;
	for (i = 0; i < monster.length; i++) {
		monster[i].id=parseInt(reg.exec(monster[i].src)[1]);
	}
}

clean();

function src(mid) {
	for (i = 0; i < monster.length; i++) {
		if (monster[i].id == mid) {
			return monster[i].src;
		}
	}
	return null;
}

function show(i) {
	return "<img src='" + src(i) + "' />";
}

function addEgg(pid) {
	var eggid;
	eggid = prompt("ID of the egg:");
	if (/^[1-9]\d{0,2}$/.exec(eggid) != null) {
		location.href = "/pad?action=lookForEggs&egg=" + eggid + "&pid=" + pid;
	}
}